import userIdentity from '../model/userIdentity.js';

export const createUserIdentity = async (request, response) => {
  try {
    const newUserIdentity = await new userIdentity(request.body);
    newUserIdentity.save();

    response.status(200).json('User identity created successfully');
  } catch (error) {
    response.status(500).json(error);
  }
};

export const updateUserIdentity = async (request, response) => {
  try {
    const userIdentityu = await userIdentity.findById(request.params.id);

    if (!userIdentityu) {
      response.status(404).json({ msg: 'User identity not found' });
    }

    await userIdentity.findByIdAndUpdate(request.params.id, { $set: request.body });

    response.status(200).json('User identity updated successfully');
  } catch (error) {
    response.status(500).json(error);
  }
};

export const deleteUserIdentity = async (request, response) => {
  try {
    const userIdentityu = await userIdentity.findById(request.params.id);

    await userIdentityu.delete();

    response.status(200).json('User identity deleted successfully');
  } catch (error) {
    response.status(500).json(error);
  }
};

export const getUserIdentity = async (request, response) => {
  try {
    const userIdentityu = await userIdentity.findById(request.params.id);

    console.log('Retrieved userIdentity:', userIdentityu);

    response.status(200).json(userIdentityu);
  } catch (error) {
    response.status(500).json(error);
  }
};


export const getAllUserIdentities = async (request, response) => {
  try {
    const userIdentities = await userIdentity.find({});



    response.status(200).json(userIdentities);
  } catch (error) {
    console.error('Error:', error); // Add this log statement

    response.status(500).json(error);
  }
};

