const mongoose = require('mongoose');

const userIdentitySchema = mongoose.Schema({
    ID: {
        type: String,
        required: true,
        unique: true,
    },
    username: {
        type: String,
        required: true,
        unique: true,
    },
    name: {
        type: String,
        required: true,
    },
    password: {
        type: String,
        required: true,
    },
    email: {
        type: String,
        required: true,
    },
    role: {
        type: String,
        required: true,
    },
    createddate: {
        type: Date,
        default: Date.now,
    }
});

const userIdentity = mongoose.model('userIdentity', userIdentitySchema);

// Add the create function
const create = async (asset) => {
    return userIdentity.create(asset);
};

module.exports = { userIdentity, create }; // Export both the model and the create function

